import React from "react";
import AuthService from "../service/auth-service";
import { Link, useHistory, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import bg from "../assets/bg1.jpg";
import Button from "react-bootstrap/esm/Button";

import image1 from "../assets/image1.jpeg";
let p = localStorage.getItem("username");
let j = localStorage.getItem("jwt");

const Adminprofile = () => {
  const navigate = useNavigate();
  const logOut = () => {
    AuthService.logout();
    navigate("/");
  };
  const [user, setFaculty] = useState([]);
  const init = () => {
    AuthService.getAdmin(p)
      .then((response) => {
        console.log("Printing faculty data", response.data);
        setFaculty(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
  useEffect(() => {
    init();
  }, []);
  return (
    <div style={{ backgroundColor: "firebrick " }}>
      <div>
        <marquee>
          {" "}
          <p className="con" style={{ color: "black", fontSize: "30px" }}>
            <b>
              <i>Welcome to Admin Dashboard </i>
            </b>
          </p>
        </marquee>
      </div>
      <div>
        {" "}
        <div
          style={{ paddingTop: "40px", marginTop: "40px", marginLeft: "38rem" }}
        >
          <Link
            className="btn btn-warning"
            to={`/User`}
            //
          >
            View Userlist
          </Link>
        </div>
        <div style={{ marginTop: "40px", marginLeft: "44rem" }}>
          <Link
            className="btn btn-warning"
            to={`/addtrain`}
            //   style={{ marginTop: "2rem", marginLeft: "15rem" }}
          >
            Add Train
          </Link>
        </div>
        <div style={{ marginTop: "40px", marginLeft: "43rem" }}>
          <Link
            className="btn btn-warning"
            to={`/Booking`}
            //   style={{ marginTop: "2rem", marginRight: "65rem" }}
          >
            View Booking
          </Link>
        </div>
        <button
          style={{ marginTop: "7rem", marginLeft: "45rem" }}
          className="btn btn-danger "
          onClick={() => {
            logOut();
          }}
        >
          Logout
        </button>
        <div class="item5">
          {" "}
          <footer id="footer">
            <ul class="navbar-nav">
              <li
                style={{
                  marginTop: "5rem",
                  marginLeft: "19.1rem",
                  fontSize: "25px",
                  color: "black",
                }}
              >
                <i> Get connected with us on</i>
                <img
                  src={image1}
                  alt="My Image"
                  style={{
                    height: "2.3rem",
                    width: "27rem",
                    marginTop: "30px",
                    marginLeft: "0.1rem",
                  }}
                />
              </li>
            </ul>
          </footer>
        </div>
      </div>{" "}
    </div>
  );
};
export default Adminprofile;
